import "./quemSomos.css";
import QuemSomosRow from "./QuemSomosRow/QuemSomosRow";

const QuemSomos = () => {
    // const src = "https://via.placeholder.com/300x350";
    const src = "https://media-exp1.licdn.com/dms/image/C4D03AQHmhmDVOnVx2g/profile-displayphoto-shrink_800_800/0/1619752537248?e=1665619200&v=beta&t=LpO6EYtt_zQ9PqWHbwU7mbGACZNHa8Il5Tc-fKoixkM";
    
    const list = [
        {
            title: "Caio Lindo",
            subtitle: "Presidente"
        },
        {
            title: "Fabinho",
            subtitle: "Vice-Presidente"
        },
        {
            title: "Caio Lindo",
            subtitle: "Presidente"
        },
        {
            title: "Fabinho",
            subtitle: "Vice-Presidente"
        },
        {
            title: "Caio Lindo",
            subtitle: "Presidente"
        },
        {
            title: "Fabinho",
            subtitle: "Vice-Presidente"
        }
    ]
    
    return (
        <div className="QuemSomos">
            <div className="QuemSomosBox">
                <div className="QuemSomosBoxHeader">
                    <h2>Quem Somos</h2>
                </div>
                <div className="QuemSomosBoxBody">
                    <QuemSomosRow src={src} title="Caio Lindo" subtitle="Presidente" isReverse={false}/>
                    <QuemSomosRow src={src} title="Fabinho" subtitle="Vice-Presidente" isReverse={true}/>
                    <QuemSomosRow src={src} title="Pablão" subtitle="Diretor de Comunioação ao Estudante" isReverse={false}/>
                    <QuemSomosRow src={src} title="Júlia Arrocha" subtitle="Diretora Financeira" isReverse={true}/>
                    <QuemSomosRow src={src} title="Nati Street Fight" subtitle="Diretora" isReverse={false}/>
                    <QuemSomosRow src={src} title="Jirão dos Eventos" subtitle="Diretor de Eventos" isReverse={true}/>
                </div>
            </div>
        </div>
    )
}

export default QuemSomos;
